{% block title %}
    2021'S MISSIONS
{% endblock %}

{% block body %}

    <h1>Mission's index</h1>

    <table class=\"table table-hover table-responsive text-center align-middle\">
        <thead>
            <tr>
                <th scope=\"col\">#</th>
                <th scope=\"col\">Status</th>
                <th scope=\"col\">Title</th>
                <th scope=\"col\">Country</th>
                <th scope=\"col\">Type</th>
                <th scope=\"col\">Description</th>
                <th scope=\"col\">Start Date</th>
                <th scope=\"col\">End Date</th>
                <th scope=\"col\">Action</th>
            </tr>
        </thead>
        <tbody>

            {% for mission in missions %}

                <tr>

                    <th scope=\"row\">{{ mission.id }}</th>
                    <td>{{ mission.status }}</td>
                    <td>{{ mission.title }}</td>
                    <td>{{ mission.country }}</td>
                    <td>{{ mission.type }}</td>
                    <td style=\"max-width: 20em\">{{ mission.description }}</td>
                    <td>{{ mission.startDate }}</td>
                    <td>{{ mission.endDate }}</td>
                    <td><a href=\"{{ path('mission_details', {'id': mission.id}) }}\">See more..</a></td>

                </tr>

            {% endfor %}

        </tbody>
    </table>

{% endblock %}
